import React, { useState } from 'react';
import { View, Text, TouchableOpacity, Image, ScrollView, StyleSheet, FlatList, TextInput, ImageBackground } from 'react-native';

const App = () => {
  const [selectedMovie, setSelectedMovie] = useState(null);
  const [selectedSeats, setSelectedSeats] = useState([]);
  const [selectedShowtime, setSelectedShowtime] = useState('');
  const [payment, setPayment] = useState(false);
  const [confirmedBooking, setConfirmedBooking] = useState(false);
  const [selectedCinema, setSelectedCinema] = useState(null);

  const cinemas = ['Cinepax Rawalpindi', 'Centaurus Cineplex', 'Nuplex'];
  const movies = [
    { id: '1', title: 'Avatar 2', poster: 'data:image/jpeg;base64,', genre: 'Action, Sci-Fi', showtimes: ['12:00 PM', '3:00 PM', '6:00 PM', '9:00 PM'] },
    { id: '2', title: 'Spider-Man: No Way Home', poster: 'data:image/jpeg;base64,', genre: 'Action, Adventure', showtimes: ['11:00 AM', '2:00 PM', '5:00 PM', '8:00 PM'] },
    { id: '3', title: 'The Batman', poster: 'data:image/jpeg;base64,', genre: 'Action, Crime', showtimes: ['1:00 PM', '4:00 PM', '7:00 PM', '10:00 PM'] },
    { id: '4', title: 'Dune', poster: 'data:image/jpeg;base64,', genre: 'Sci-Fi, Adventure', showtimes: ['10:00 AM', '1:00 PM', '4:00 PM', '7:00 PM'] },
  ];

  const seats = ['A1', 'A2', 'A3', 'A4', 'B1', 'B2', 'B3', 'B4', 'C1', 'C2', 'C3', 'C4'];

  const handleSelectMovie = (movie) => {
    setSelectedMovie(movie);
    setSelectedSeats([]);
    setPayment(false);
    setSelectedShowtime('');
    setConfirmedBooking(false);
  };

  const handleSelectSeat = (seat) => {
    setSelectedSeats((prev) => prev.includes(seat) ? prev.filter(s => s !== seat) : [...prev, seat]);
  };

  const handleSelectShowtime = (showtime) => {
    setSelectedShowtime(showtime);
  };

  const handleSelectCinema = (cinema) => {
    setSelectedCinema(cinema);
  };

  const handleProceedToPayment = () => {
    if (!selectedShowtime || selectedSeats.length === 0 || !selectedCinema) {
      alert('Please select a cinema, showtime, and seats');
      return;
    }
    setPayment(true);
  };

  const handleConfirmBooking = () => {
    setConfirmedBooking(true);
  };

  return (
    <ImageBackground
      source={{ uri: 'data:image/jpeg;base64,' }} // Replace with your background image URL
      style={styles.container}
    >
      <ScrollView contentContainerStyle={styles.scrollContainer}>
        <Text style={styles.header}>CinePax - Movie Booking</Text>

        {/* Cinema Selection */}
        <Text style={styles.sectionTitle}>Choose Cinema</Text>
        <FlatList
          data={cinemas}
          horizontal
          renderItem={({ item }) => (
            <TouchableOpacity
              style={[
                styles.cinemaButton,
                selectedCinema === item && styles.selectedCinemaButton,
              ]}
              onPress={() => handleSelectCinema(item)}
            >
              <Text style={styles.cinemaText}>{item}</Text>
            </TouchableOpacity>
          )}
          keyExtractor={(item, index) => index.toString()}
        />

        {/* Movie List */}
        <Text style={styles.sectionTitle}>Now Showing</Text>
        <FlatList
          data={movies}
          horizontal
          renderItem={({ item }) => (
            <TouchableOpacity style={styles.movieCard} onPress={() => handleSelectMovie(item)}>
              <Image source={{ uri: item.poster }} style={styles.moviePoster} />
              <Text style={styles.movieTitle}>{item.title}</Text>
            </TouchableOpacity>
          )}
          keyExtractor={(item) => item.id}
        />

        {/* Movie Details */}
        {selectedMovie && (
          <View style={styles.movieDetails}>
            <Text style={styles.movieDetailsTitle}>{selectedMovie.title}</Text>
            <Text style={styles.movieDetailsGenre}>{selectedMovie.genre}</Text>

            {/* Showtime Selection */}
            <Text style={styles.sectionTitle}>Select Showtime</Text>
            <FlatList
              data={selectedMovie.showtimes}
              horizontal
              renderItem={({ item }) => (
                <TouchableOpacity
                  style={[
                    styles.showtimeButton,
                    selectedShowtime === item && styles.selectedShowtimeButton,
                  ]}
                  onPress={() => handleSelectShowtime(item)}
                >
                  <Text style={styles.showtimeText}>{item}</Text>
                </TouchableOpacity>
              )}
              keyExtractor={(item, index) => index.toString()}
            />

            {/* Seat Selection */}
            <Text style={styles.sectionTitle}>Select Your Seats</Text>
            <ScrollView contentContainerStyle={styles.seatContainer}>
              {seats.map((seat, index) => (
                <TouchableOpacity
                  key={index}
                  style={[
                    styles.seat,
                    selectedSeats.includes(seat) && styles.selectedSeat,
                  ]}
                  onPress={() => handleSelectSeat(seat)}
                >
                  <Text style={styles.seatText}>{seat}</Text>
                </TouchableOpacity>
              ))}
            </ScrollView>

            {/* Proceed to Payment Button */}
            <TouchableOpacity
              style={[styles.button, styles.proceedButton]}
              onPress={handleProceedToPayment}
            >
              <Text style={styles.buttonText}>Proceed to Payment</Text>
            </TouchableOpacity>
          </View>
        )}

        {/* Payment Screen */}
        {payment && (
          <View style={styles.paymentScreen}>
            <Text style={styles.paymentTitle}>Enter Payment Details</Text>
            <TextInput style={styles.input} placeholder="Card Number" keyboardType="numeric" />
            <TextInput style={styles.input} placeholder="Expiry Date" keyboardType="numeric" />
            <TextInput style={styles.input} placeholder="CVV" keyboardType="numeric" />

            <TouchableOpacity style={styles.button} onPress={handleConfirmBooking}>
              <Text style={styles.buttonText}>Pay Now</Text>
            </TouchableOpacity>
          </View>
        )}

        {/* Booking Confirmation */}
        {confirmedBooking && (
          <View style={styles.bookingConfirmation}>
            <Text style={styles.confirmationTitle}>Booking Confirmed!</Text>
            <Text style={styles.bookingDetails}>Cinema: {selectedCinema}</Text>
            <Text style={styles.bookingDetails}>Movie: {selectedMovie.title}</Text>
            <Text style={styles.bookingDetails}>Showtime: {selectedShowtime}</Text>
            <Text style={styles.bookingDetails}>Seats: {selectedSeats.join(', ')}</Text>
            <TouchableOpacity
              style={[styles.button, styles.confirmButton]}
              onPress={() => alert('Thank you for booking!')}
            >
              <Text style={styles.buttonText}>Go to Home</Text>
            </TouchableOpacity>
          </View>
        )}
      </ScrollView>
    </ImageBackground>
  );
};

